import React from "react";
import { YMaps, Map, Placemark } from 'react-yandex-maps';

const MapComponent = () => {
  return (
    <YMaps query={{apikey: 'c8b9e28d-92e5-436f-a252-fe89b025381f'}}>
      <Map
        defaultState={{ center: [55.75, 37.57], zoom: 9 }}
        width="100%" // Устанавливаем ширину карты на 100% от родительского контейнера
        height="400px" // Устанавливаем высоту карты в 400 пикселей
      >
        <Placemark geometry={[55.75, 37.57]} />
      </Map>
    </YMaps>
  );
}

export default MapComponent;
